0:00','','Slider Image2','','draft','closed','closed','','of-slider_image2','','','2015-02-09 15:19:28','0000-00-00 00:00:00','',0,'http://transcorvalle.com/?post_type=optionsframework&p=15',0,'optionsframework','',0),(17,1,'2015-02-12 13:35:34','2015-02-12 13:35:34','<em><strong>Misión:</strong></em> Prestar el servicio de transporte tanto a personas naturales como a empresas y colegios, a través de un equipo humano amable, calificado y comprometido con brindar un excelente servicio, en forma segura y a precios justos, para satisfacer los requerimientos de nuestros clientes, soportado en una estructura moderna y confortable.\r\n\r\n<em><strong>Visión:</strong></em> En el año 2020, Transportes Corazón del Valle Transcorvalle S.A.S., será reconocida como la primera entidad de servicios de transporte especial, a nivel Regional, con un equipo humano profesional, eficiente y comprometido <strong> </strong>con el cambio y desarrollo de nuestra organización para satisfacer las necesidades,  expectativas y requerimientos de nuestros clientes.<strong>        </strong>\r\n\r\n<em><strong>Normatividad:</strong></em> <strong>Transcorvalle S.A.S., </strong>está habilitada por el ministerio de transporte mediante la resolución 0002 del 29 de enero del 2001. Es una empresa vigilada por la superintendencia de puertos y transporte. Además cuenta con la certificación NTC6001:2008 que fue aprobada en el año 2012. Sumado a esto se diseña un plan de seguridad vial según las rutas y vehículos programados para la prestación del servicio.\r\n\r\n&nbsp;\r\n\r\n&nbsp;','Quienes Somos','','publish','closed','closed','','quienes-somos','','','2015-02-21 20:41:57','2015-02-21 20:41:57','',0,'http://transcorvalle.com/?page_id=17',0,'page','',0),(18,1,'2015-02-12 13:35:34','2015-02-12 13:35:34','Misión: Prestar el servicio de transporte tanto a personas naturales como a empresas y colegios, a través de un equipo humano amable, calificado y comprometido con brindar un excelente servicio, en forma segura y a precios justos, para satisfacer los requerimientos de nuestros clientes, soportado en una estructura moderna y confortable.\r\n\r\nVisión: En el año 2020, Transportes Corazón del Valle Transcorvalle S.A.S., será reconocida como la primera entidad de servicios de transporte especial, a nivel Regional, con un equipo humano profesional, eficiente y comprometido <strong> </strong>con el cambio y desarrollo de nuestra organización para satisfacer las necesidades,  expectativas y requerimientos de nuestros clientes.<strong>        </strong>\r\n\r\nNormatividad: <strong>Transcorvalle S.A.S., </strong>está habilitada por el ministerio de transporte mediante la resolución 0002 del 29 de enero del 2001. Es una empresa vigilada por la superintendencia de puertos y transporte. Además cuenta con la certificación NTC6001:2008 que fue aprobada en el año 2012. Sumado a esto se diseña un plan de seguridad vial según las rutas y vehículos programados para la prestación del servicio.','Quienes Somos','','inherit','open','open','','17-revision-v1','','','2015-02-12 13:35:34','2015-02-12 13:35:34','',17,'http://transcorvalle.com/?p=18',0,'revision','',0),(19,1,'2015-02-12 13:39:07','2015-02-12 13:39:07','<em><strong>Misión:</strong></em> Prestar el servicio de transporte tanto a personas naturales como a empresas y colegios, a través de un equipo humano amable, calificado y comprometido con brindar un excelente servicio, en forma segura y a precios justos, para satisfacer los requerimientos de nuestros clientes, soportado en una estructura moderna y confortable.\r\n\r\n<em><strong>Visión:</strong></em> En el año 2020, Transportes Corazón del Valle Transcorvalle S.A.S., será reconocida como la primera entidad de servicios de transporte especial, a nivel Regional, con un equipo humano profesional, eficiente y comprometido <strong> </strong>con el cambio y desarrollo de nuestra organización para satisfacer las necesidades,  expectativas y requerimientos de nuestros clientes.<st